        private void button_calcular_Click(object sender, EventArgs e)
        {
            if (combo_origen.Text != "" && combo_destino.Text != "")
            {
                origen = combo_origen.SelectedIndex-1;
                destino = combo_destino.SelectedIndex-1;
                string[] arr = calculaDijkstra(origen, matriz, destino);

                string resultado = "Se visitarian las ciudades de " +  arr[1] + ", con una distancia total de " + arr[0] + " Km";
                MessageBox.Show(resultado, "Recorrido", MessageBoxButtons.OK, MessageBoxIcon.Information);
                //MessageBox.Show(arr[0]);
                //MessageBox.Show(arr[1]);

            }
        }
        static string[] calculaDijkstra(int origen, int[,] matriz, int destino)
        {
            int actual = origen;
            int minimo = int.MaxValue;
            int longitudMatriz = matriz.GetLength(0);
            int[] minDist = new int[longitudMatriz];

            bool[] marcador = new bool[longitudMatriz];

            string[] ultimovisto = new string[longitudMatriz];
            string[] arr = new string[2];

            int[] matrizciudad = new int[longitudMatriz];

            for (int x = 0; x < longitudMatriz; x++)
            {
                marcador[x] = false;
                minDist[x] = int.MaxValue;
            }

            minDist[origen] = 0;

            string[] ciudadesrecorridas = new string[longitudMatriz + 1];

            for (int x = 0; x < longitudMatriz; x++)
            {
                marcador[actual] = true;

                for (int y = 0; y < longitudMatriz; y++)
                {
                    if (!marcador[y] && matriz[actual, y] != -1 && minDist[y] > minDist[actual] + matriz[actual, y])
                    {
                        ciudadesrecorridas[y] = ciudadesrecorridas[actual] + ", " + RegresaCiudad(y);
                        ultimovisto[actual] += y.ToString() + ",";
                        matrizciudad[x] = y;
                        minDist[y] = minDist[actual] + matriz[actual, y];
                    }
                }

                minimo = int.MaxValue;

                for (int y = 0; y < longitudMatriz; y++)
                {
                    if (!marcador[y] && minDist[y] < minimo)
                    {
                        actual = y;
                        minimo = minDist[y];
                    }
                }
            }

            arr[0] = minDist[destino].ToString();
            arr[1] = RegresaCiudad(origen) + ciudadesrecorridas[destino];
            return arr;
        }

